let data={sketch:{background:"#00000001"}};function setup(){createCanvas(windowWidth,windowHeight),noFill(),noStroke(),angleMode(DEGREES),colorMode(HSL,100)}function draw(){background(data.sketch.background),translate(0.5*width,0.5*height);for(var a=30+30*sin(frameCount);0<a;a-=1)if(push(),fill(map(a,60,0,100,0),100,50,2),1<a)for(var b=1;b<a+1;b+=1){let c=10*Math.log(10*a)*sin(frameCount),d=360*b/a+frameCount,e=3*tan(frameCount+a+frameCount),f=(a-1)*e*sin(c+d),g=(a-1)*e*tan(c+d),h=a*e*sin(c+d),k=a*e*tan(c+d);push(),rotate(frameCount*Math.log(a)),ellipse(f,g,h,k),pop()}pop()}